INSERT INTO `ss_company` (`company`, `id`, `delflag`, `createAt`, `updateAt`, `addr`, `name`, `src`, `url`, `detail`, `refid`) VALUES
('南京坦道信息科技有限公司', 2, 0, NULL, NULL, '南京市麒麟科技创新园(生态科技城)东麒路666号', '南京坦道信息科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC456313124.htm', '南京坦道信息科技有限公司（前身为中盈优创资讯科技有限公司资讯系统部）是一家致力于通信行业软件和服务的IT高新技术企业，主要从事电信行业的数据分析应用和业务支撑相关的软件开发和服务提供，整合了原公司在通信行业应用支撑、数据仓库开发和服务的产品、市场、人员等资源，为客户提供稳定和持续高质量服务。公司总部设在南京，现有员工百余名，员工本科及以上学历占90%，市场遍及江苏、四川、陕西、甘肃、山西等多个电信省级公司。公司通过多年的自主研发和市场开拓，在企业经营决策智能支撑系统、电信渠道支撑管理系统、电信收入保障及业务稽核系统、全渠道知识管理及客户化知识库系统等方面形成了行业优势。公司推崇“创新、勤奋、互助”的公司文化，立志成为电信行业细分市场的行业领先者，为电信提供高效的运营和管理支撑。', '456313124'),
('扬州动艺信息技术有限公司', 3, 0, NULL, NULL, '江苏省扬州市邗江区商城国际大厦1810', '扬州动艺信息技术有限公司', 'zhilian', 'http://company.zhaopin.com/CC486550936.htm', '扬州动艺信息技术有限公司正式成立于2013年3月，是一家专业从事手机APP，游戏，微信推广等业务的软件公司。', '486550936'),
('江苏华腾软件科技有限公司', 4, 0, NULL, NULL, '扬州市邗江中路凯旋国际大厦12楼', '江苏华腾软件科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC599670924.htm', '一、 公司简介         江苏华腾软件科技有限公司创建于2009年，是一家集软件开发、销售、服务为一体的专业性软件公司。4年来公司专心于应用软件的开发，专注于手机端平台运用的开发，专注于网站建设的维护和搜索引擎的优化，以及网络营销技术和服务领域的研究。         江苏同城家长圈网络科技有限公司，江苏华腾旗下的子公司。目前是扬州本地最专业、最具影响力的家长互助分享社区，目前论坛、qq群及微信公众号已辐射近10万+家长粉丝，覆盖75%以上的小升初及中考家长，未来基本可覆盖90%家长，流量决定市场。其核心功能是升学政策解读、机构点评、放心交易。  ', '599670924'),
('苏州邱伦电子有限公司', 5, 0, NULL, NULL, '苏州相城聚金路28号，大峻科技园', '苏州邱伦电子有限公司', 'zhilian', 'http://company.zhaopin.com/CC645419926.htm', '    苏州邱伦电子有限公司成立于2012年，是集研发、设计、制造销售为一体的技术密集型企业。主要从事各类专用设备，非标自动化设备，以及各种工装治具的设计及制作，公司以人才优势，具有独立开发、设计能力，涉及机构、电控、软件、电子等众多领域，主要产品有全自动贴装机（自动贴标机、贴盖机、贴麦拉机、贴补强机等多个系列产品），自动喷码机，视觉检测系统，整线规划，及各种电子产品测试系统等一系列电子制作行业应用产品。    邱伦以个性化的管理模式，开放、创新、合作的理念，旨在打造一个自由的平台，充分展现邱伦人独特的设计理念，期待你能成为我们中的一员，为中国制造增添一丝色彩。', '645419926'),
('扬州天苗科技有限公司', 6, 0, NULL, NULL, '江阳西路绿地锋创国际B座15楼', '扬州天苗科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC535000825.htm', '公  司  简  介 扬州天苗科技有限公司成立于2001年，是扬州地区专业从事软件开发的高科技公司，公司下设软件研发部、无锡物联网研究院扬州办事处、北斗卫星应用扬州总代理、市场推广部、客服部。主要围绕财政改革及政府财政信息网络系统（金财工程）建设的需要，从事相关软件的研制开发、推广应用、服务及网络构建工作，以各级财政和广大行政事业单位为服务主体，密切关注财政改革信息化需求，不断开发、完善财政管理改革过程中不同管理层次、不同管理模式、不同发展阶段的规范化、标准化信息技术与产品，并为各地“金财工程”的建设提供完整的解决方案。是 “金财工程”建设的软件供应商之一。天苗科技作为财政信息化的建设者和推进者，我公司将利用业界最新的计算机网络、信息技术，不断探索各种财政事务系统化、数字化、网络化的解决方案，为最终实现全国财政综合管理自动化而不懈努力；为此，公司将不断发扬“开拓、服务、求实、合作”的企业精神，树立公司的良好形象，建立扬州市财政信息化领域的第一品牌，并在此基础上争取成为省内行业最有价值的企业。', '535000825'),
('扬州宏创科技发展股份有限公司', 7, 0, NULL, NULL, '扬州市广陵区信息服务产业基地声谷二期11幢E座3F', '扬州宏创科技发展股份有限公司', 'zhilian', 'http://company.zhaopin.com/CC655296723.htm', '扬州宏创科技发展股份有限公司简介扬州宏创科技发展有限公司成立于2013年，是一家集自主研发、生产、销售、服务为一体的高科技公司。公司团队拥有的专业素质和丰富的行业经验，是一支具备超凡创意和活力的团队。公司专注于自助研发、生产DRP软件、OA软件、手机云系统等，经过不断努力，公司站在数据、软件技术的前沿，凭借现代化的企业管理手段与优秀高效的团队，不断发挥自身优势和整合行业资源，为企业提供全方位的服务，专业为成长型企业提供量身定制的信息化解决方案。目前，公司拥有完善的软件技术产品和专业的解决方案，生产的产品已涵盖生产、分销、物流、办公等多个方面，2013年，公司与地方龙头企业形成战略合作，将公司发展战略从单纯的信息网络维护、软件开发向电子商务环节延伸。即面向市民推出“线上订货，线下取货”蔬菜订购配送服务，将蔬菜基地绿色天然的放心蔬菜从基地采摘后直接送到家门口的线下取货点，做市民家门口的果蔬园！    作为一家发展中的高科技公司，宏创科技秉持精诚合作的企业精神，倡导简单和谐的人际关系；在研发上，我们始终坚持严谨、创新的科学态度；在经营上，我们以服务共赢作为企业的经营理念；在售前，我们认真细致听取客户需求，为客户选择最合适的产品, 提供最佳解决方案；在售后，我们耐心解答客户问题，及时、准确接收客户的反馈信息，改进我们的产品和服务，让我们的客户在激烈的市场竞争中处于有利位置，并抢占商机，以卓越优质的服务提升企业核心竞争力。     ', '655296723'),
('薪火网络科技(上海)有限公司', 8, 0, NULL, NULL, '上海市', '薪火网络科技(上海)有限公司', 'zhilian', 'http://company.zhaopin.com/CC648643025.htm', '    薪火网络是初创企业，致力于互联网产品的研发，注册资本2000万， 公司第一阶段的发展目标就是，关注客户需求，定位于蓝海市场。目前第一期产品已在内测阶段。这是一支有活力、有实力、有智慧的团队，领导班子是80后白手起家的创业者，北大青鸟校长为技术负责人。 扁平化的管理模式，以人为本的管理制度，轻松的工作氛围。通过职业发展和薪资福利等人才激励机制，做到让员工将工作都当成事业来干！关于招兵买马：我们的人才理念是——永远在雇人，对于优秀的人才，薪火永远有兴趣。', '648643025'),
('中软卓越', 9, 0, NULL, NULL, '.', '中软卓越', 'zhilian', 'http://company.zhaopin.com/CC354307322.htm', '中软国际教育集团（下设中软国际卓越培训中心和中软国际卓越体验中心，简称中软卓越）是中软国际旗下的软件人才实训机构，自成立之初，即承担为中软国际集团（股票代码：HK.0354）业务线人才储备、人才输送的重要任务，是中软国际软件及外包业务快速发展的重要人才支撑平台。　　十余年来，中软国际集团规模持续扩张，业务稳健发展，员工总数由最初的百余人，增长到现在的38000人（截至2015年底）。作为中软国际人才战略的重要组成部分，中软卓越与500余所高等院校开展长期广泛的合作，超过30家实训基地遍布全国20余个大中城市，年培训规模超过5万人，累计为中软国际输送数以万计的新鲜血液，为中软国际的快速发展起到了重要的人才储备及输送作用。　　为确保集团业务的高效开展，中软卓越面向中软国际的人才输送体系有严谨的筛选及管理流程：　　1、经简历筛选获得面试机会的候选人，需经过专业的笔试、面试等环节，其中，符合业务线招聘要求的应聘者，可直接进入企业参加工作。　　2、对于不符合业务线人才需求的应聘者，如本人加入中软国际意愿强烈，中软国际也会为面试者提供参加实训课程的机会，即参加中软卓越5R实训（即：真实的工作环境、真实的项目经理、真实的项目案例、真实的工作压力、真实的就业机会），结业后再次进入招聘流程。　　3、二次招聘环节，仍遵循严格的筛选原则，在招聘环节中有良好表现的应聘者可进入中软国际业务线工作；对于仍不符合中软国际要求的应聘者，中软卓越也将帮助应聘者提升专业能力推荐其他软件企业的面试机会。　　考虑到在初次应聘未通过、又希望通过参加培训的应聘者中，有一些是刚刚毕业的大学生，经济能力有限。针对这部分应聘者，中软卓越与第三方信用担保机构合作，先由担保机构帮助应聘者将培训费用一次性支付，应聘者在培训期间只需支付担保机构少量利息。在其完成培训、顺利走上工作岗位之后，再分期偿付担保机构本金和利息尾款。通过这样的方式，大大地减轻了初入社会应聘者的经济负担，帮助大批应届毕业生顺利步入职场，迈过“就业难”的关口。　　2016年，是中软国际“再出发”的关键一年，集团业务已进入快速发展通道。中软卓越将继续以严谨的态度执行中软国际的人才储备及培养任务，持续不断地为集团发展壮大输送大量优质的新鲜血液。中软卓越也始终怀有一颗开放的心态，愿与社会各界希望致力于软件人才培养的院校、企业携手合作，共同为“互联网＋”及“中国制造2025”培养高质量的软件人才！ ', '354307322'),
('江苏南邮电信工程有限责任公司', 10, 0, NULL, NULL, '江苏南邮电信工程有限责任公司', '江苏南邮电信工程有限责任公司', 'zhilian', 'http://company.zhaopin.com/CC564353927.htm', '       江苏南邮电信工程有限责任公司(原名南京邮电大学电信工程公司.以下简称南邮公司)是南京邮电大学控股的股份制企业,企业注册资本1800万元,具有国家工信部核准颁发的通信信息网络系统集成乙级资质证书、住建部颁发的电信工程专业承包三级资质证书.南邮公司成立于1994年,依托南京邮电大学在软件及其通信领域的技术和人才优势,已进入软件开发、光纤数字通信、无线微波通信、移动通信、交换、会议电视、楼宇自控、综合布线等技术领域的工程设计、施工与维护,参与了有关科研项目及通信产品的代理与销售。          公司在长期保持省内软件行业及通信工程服务综合实力最强、省外稳居全国同类企业前列的基础上，始终坚持创新发展，近几年来更在优先服务好江苏全省、积极拓展省外和国外软件开发及通信工程市场的快速发展过程中，在国家“推动信息化和工业化深度融合”发展战略和推进企业科技进步政策的引导下，走出了一条科技含量日益提高的创新发展之路。公司在全年多达数万个工程服务项目中，注重发挥和运用好技术和管理优势；围绕全业务经营，重点针对行业系统集成、信息咨询设计与产品研发生产，突出培育通信信息网络建设与维护、网规网优、系统集成、小区智能化等具有业内领先水平的专业服务领域；公司在传统通信市场、集团客户市场及海外市场的拓展中屡有良好表现，及时完成了大批急难险重的工程任务，受到业内和社会各界的多方好评。 ', '564353927'),
('扬州网畅智城网络科技有限公司', 11, 0, NULL, NULL, '扬州市广陵区汽车东站信息产业基地一期9号2楼', '扬州网畅智城网络科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC623891621.htm', '扬州网畅智城网络科技有限公司定位为城市级WiFi运营商，深耕国内二三线城市，目前在扬州、泰州、常州、徐州、连云港、重庆等省内外多地设立区域公司，独创城市级微信连WiFi体系，全力打造区域第一“移动媒体+O2O平台”。 我们拥有自主知识产权的WIFI设备及云端管理平台，通过与政府主管部门及电信运营商的深度合作，为江苏省范伟内的商户、景区、会展、大型活动以及公共区域等提供成熟的公共WIFI服务。我公司主要业务包括无线网络建设、信息安全维护、移动新媒体建设与服务、移动互联网技术开发、企业品牌推广等！分公司扬州北斗软件有限公司是一家专业从事软件开发的企业，主要业务分为三类：为传统企事业单位定制开发O2O软件，为其提出线上线下一体化解决方案；为企业提供行政办公应用软件设计、开发、维护一站式的服务；开发“WiFi+”软件，通过WiFi固件研发、行业软件开发，为行业提供O2O方案。                ', '623891621'),
('南京皓思电气有限公司', 12, 0, NULL, NULL, '江苏省南京市', '南京皓思电气有限公司', 'zhilian', 'http://company.zhaopin.com/CC428377623.htm', '皓思电气有限公司是一家专业制造、开发和生产自动化控制开关电器的高新技术企业。公司拥有现代化的生产检测设备及一支高素质的研发队伍和管理团队、团队的骨干人员具备优良的专业知识、不断的吸纳国际先进的技术和设计理念、为产品的质量品质提供了可靠的保证，公司现于2010公司生产规模扩大，并还根据客户的要求、图纸外生产加工及销售高低压成套柜体等一系列附件产品，公司现所有产品完全符合IEC标准和国家标准；公司产品广泛应用于：冶金、煤矿、钢铁、石化、港口、船舶、，铁路、机电、大型商场等行业的供电控制系统。公司一贯重视现代化科学管理、建立了完善的质量保证系统、并通过了ISO9001-2000质量体系认证、所有产品已获得国家强制性产品认证及自愿性认证。多年来、由于公司产品功能齐全、性能可靠、价格合理、交货及时、服务周到、赢得了广大顾客的信任和好评。雄厚的技术力量、精湛的检测能力、先进的生产设备、完善的售后服务、为顾客提供一流的产品质量和信誉。竭诚与国内外新老客户携手合作、共创未来。', '428377623'),
