('南京瑞玥科技有限公司', 14, 0, NULL, NULL, '南京市鼓楼区中山北路212号永昌大厦10楼1000', '南京瑞玥科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC144308677.htm', '南京瑞玥科技有限公司成立于2006年，公司注册资本500万人民币。公司是专业从事自主软件平台开发、软件外包服务、数据仓库分析服务、系统集成及多媒体制作的高科技公司，是江苏省双软企业、南京市大学生就业实习基地、IBM软件人才培训合作伙伴、中国移动合作伙伴。公司现设有办公室、人力资源部、财务部、通信软件部、交通事业部、公安事业部、医院事业部、售后服务部、技术研究部等多个部门。公司专注于自主知识产权的软件开发，有稳定、高效的开发团队，分别从事公安、安全、移动通信、医院、交通、教育等单位的软件系统设计、开发及运维。公司目前在江苏省、山东省、湖北省、安徽省等多地市设有办事处，并开展相关业务。南京瑞玥科技有限公司本着培育、珍惜、关怀员工、让每一位同仁尽情地发挥最高潜力的人才理念，坚守诚信、勤俭、崇本、务实的正道，诚邀您与公司一起成长。 员工享有的福利1）社会统筹（养老、医疗、失业、工伤、生育）保险；2）在当地工作时的食、宿、水电等补助；3）带薪年休假、带薪病假、带薪婚假、产假及陪护假；4）国家法定节假日；5）端午、中秋、元旦、春节等传统节日礼金；6）团队活动；7）年底奖金；8）可办理南京市户口； ', '144308677'),
('海普康(扬州)自动化技术有限公司', 15, 0, NULL, NULL, '扬州市科技区广陵产业园路25号科创园B1幢', '海普康(扬州)自动化技术有限公司', 'zhilian', 'http://company.zhaopin.com/CC538591328.htm', '﻿﻿海普康（扬州）自动化技术有限公司是上海拓普控制工程有限公司在扬州投资的全资子公司。上海拓普公司始创于1995年，是专业从事自动化控制电气产品研发和系统集成的股份合作制技术型企业。        公司总部位于上海浦东新区金桥出口加工区南区中邦商务园，专业从事自动化产品的设计研发和市场营销工作。公司在风景秀丽古城江苏省扬州市广陵产业园科创园建有加工制造基地—海普康（扬州）自动化技术有限公司。        公司早期主营业务主要从事自动化控制工程项目系统设计制造及现场调试服务，参与了该帘子线化纤行业从化工聚合，纺丝，牵伸，加捻，织布，浸胶全流程自动化系统控制项目，取得了良好工程业绩，国内帘子布龙头骨干企业都选用了我公司专为此行业研制的控制系统产品，并与我公司建立了长期良好协作关系。同时公司还积极参与了跨行业自动化控制系统项目，包括老系统升级换代改造和进口电气系统替代改造。        2002年起与国内知名纺机企业以ODM合作方式开展机电一体化战略合作，先后成功研发了K3501A/B直捻机电控系统，K3502地毯直捻机电控系统，K3521工业丝倍捻机控制系统，CGKV548C/CGKV549C玻捻机四大电控系统，均已得到配套推广应用和出口欧美东南亚等国家，其控制系统水平在可靠性和性能上处国内领先位置，并对类似进口机械装置其控制系统具备替换性。        2004年与浙江金轮机电有限公司以机电股份合作形式组建上海金轮拓普机电有限公司，专业从事帘子布浸胶机机电一体化设计制造及销售服务。主要产品有帘子布单浴/双浴浸胶机，帘子线单浴/双浴浸胶机，帘子线单浴/双浴浸胶试验机。国内帘子布主要骨干企业和一些外资企业都选用了我公司浸胶机产品，该浸胶生产线产品凭借良好性价比优势已成功进入海外市场。        2008年起正式涉足船舶自动化船控产品领域，以超越同行的独特全新设计理念和品牌定位，进行船控产品研发，先后推出了海普康®新一代航行灯信号灯控制器，航海故障报警器，桥楼值班报警系统，船舶信息化管理系统等船控产品，业已取得良好市场反响，全系列船控产品已列入公司研发规划，不远将来海普康®将为船舶自动化行业献上更多精彩作品。        我们将凭借多年来从事工业自动化控制项目积累的技术研发优势与工程经验，把技术创新与技术研发作为公司生存与发展的原动力，珍惜市场赋予我们的每一次机会，点滴积累辛勤耕耘，向成熟自动化公司迈进，成为有行业影响力的受人尊敬的自动化公司，为民族自动化领域增光添彩。', '538591328'),
