('江苏中智软创信息技术有限公司', 18, 0, NULL, NULL, '江苏省无锡市惠山经济开发区智慧路18号O-Park大厦502室', '江苏中智软创信息技术有限公司', 'zhilian', 'http://company.zhaopin.com/CC380129380.htm', '江苏中智软创信息技术有限公司是一家集信息系统集成服务；软件开发；电子商务技术的研发、技术服务、技术咨询、技术转让等多项计算机软件开发业务的公司，是一家走在智能化前端的新兴公司。公司目前在无锡惠山经济开发区建造产业园区，诚聘各方优秀人才。', '380129380'),
('江苏畅远信息科技有限公司', 19, 0, NULL, NULL, '江苏省镇江市丁卯经十五路99号科技新城30幢3楼', '江苏畅远信息科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC287380980.htm', '江苏畅远信息科技有限公司是国家首个中小企业知识产权托管平台和江苏省技术转移平台的承担单位。成立于2009年，注册资本1000万元，国家高新技术企业、省软件企业；总部位于镇江科技新城中心研发区内，在深圳、青岛、南京、苏州、南通等地建有分支机构。公司主要从事知识产权管理与科技信息服务平台的建设与运营、企业科技服务整体解决方案设计、中小企业知识产权托管方案设计、技术转移与专利运营、企业管理体系建设优化等综合服务。近年来，公司产品广泛服务于1000余家企业及政府和事业单位。公司被评定为国家知识产权分析评议服务示范机构、省知识产权战略推进计划项目实施辅导机构、省知识产权贯标咨询辅导机构、省科技服务骨干机构、省三星级公共服务平台、省研究生工作站、镇江市知识产权服务联盟秘书长单位。先后承担了30多项国家、省、市各级科技项目的实施。公司坚持以专业、共赢、超越的经营理念，致力于打造高品质的知识产权服务专家。', '287380980'),
('扬州润迈信息科技有限公司', 20, 0, NULL, NULL, '扬州市扬子江中路186号扬州智谷B座12F', '扬州润迈信息科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC294797935.htm', '   扬州润迈信息科技有限公司主要为国内政府机构、公用事业、教育、企业提供软硬件产品服务、软件外包、咨询和人力资源服务。未来，公司将立足于计算机软件开发与服务业，加速发展高端软件外包业务，深耕专业领域与细分市场，不断增加核心竞争力，持续提升行业地位，力争将公司打造成国内领先的软件外包服务品牌。我们奉行“以人为本”的用人理念，注重人才的培养，尊重每一位员工，对每一位加盟公司的员工提供舒适的工作环境、提供完善的社会福利保险。如果您加入我们的团队，您将享受以下福利：1、五险一金              公司为员工提供“五险一金”的福利保障，即养老、医疗、失业、工伤、生育和住房公积金。      2、带薪休假               除国家法定假期外，每位员工还享有年假以及公司福利假。     3、免费体检              公司为员工提供免费体检。  4、 旅游   每年组织员工进行旅游。 5、其他补贴            我们为员工提供年底双薪、 项目奖金、餐补及交通补贴。', '294797935'),
('江苏油鱼信息科技有限公司', 21, 0, NULL, NULL, '扬州市邗江区江阳西路108号峰创国际大厦A座', '江苏油鱼信息科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC435961783.htm', '    油鱼理财(imyoyofish.com)是由于江苏油鱼信息科技有限公司所创建国内先进规范的互联网金融信息服务平台品牌 ,提供优质信息服务    江苏油鱼信息科技有限公司注册资金1.36亿，响应江苏省十三五互联网+相应产业政策计划而成立，着眼江苏地区多项城市经济发展高速推行，整体GDP即将成为全国第一省份，民生消费快速成长，选择深度布局江苏省进而覆盖全华东地区的协助传统流通性行业全面互联网+改造。     首要计划由金融信息服务为起点，推出油鱼理财品牌，提供双向金融信息服务串接全国网友及江苏市场的优质企业，透过严密的企业信评，资评大数据技术，筛选优质企业，提供方便快捷的融资信息发布渠道，也为广大网友提供小额分散的出借投资服务平台。    进而逐步进展到各地区优质中小微零售服务行业b2b资源互助对接平台，快速流通商业信息增速企业成长，刺激经济发展。    最后整合企业服务资源推出O2O生活消费服务平台，提供地区市场用户比一般电商更细致,更在地化的消费信息服务，使地区传统企业参与到互联网发展红利当中，通过三阶段目标完成，油鱼网希望创造江苏地区企业或个人更美好的城市生活。    油鱼理财，凝聚国内外专业金融及商业评估管理，财会审计专业团队，进驻长三角城市群核心位置，致力于服务江苏省及大华东地区上市企业，全国性消费品牌企业等资产管理及金融信息服务，间接参予多项重大城市化建设，具备坚实的金融业务管理能力。    油鱼理财(imyoyofish.com)是用户核心观的互联网金融服务平台，着眼国内新一轮创客经济崛起的青年动力，提供辅助的双向互联网金融服务，提倡『有余才是赚!』的财富积累观念，力求在动荡浮夸的经济创新年代，提供年轻人一个清新，简单，安全，便捷的金融服务平台，', '435961783'),
('江苏兆数通网络科技有限公司', 22, 0, NULL, NULL, '江苏兆数通网络科技有限公司', '江苏兆数通网络科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC479081532.htm', '兆数通网络科技有限公司是由一批具有国内著名网络公司服务背景的网络精英所组成，年轻、富有活力，注定一开始就是一家成熟的网络科技公司，是一家专业从事网站建设、软件开发和手机APP的互联网基础运营商。    我们全心致力于企事业单位建站和电子商务的应用及推广。公司拥有独立的高端服务器，托管于广州电信主干机房，提供从域名注册、虚拟主机、中文网址、企业邮箱、网站建设、网站推广、网络营销和软件开发的企业上网全程服务。行业涉及机械、医药、卫生、建筑、 IT 、纺织、娱乐、物流、咨询、房产、汽车等，具有丰富的设计经验。    我们以奉献网络科技而缩短人类之间沟通的距离，提升政府、企业的形象，为客户创造价值为自身的社会使命，以提供各种上网解决方案为中心开展业务工作。    我们从市场的角度和客户的需求出发，帮助企业极其产品树立良好的视觉形象，拓展市场空间创造竞争优势，提升企业的无形资产。     我们亦明知时代赋予设计师的伟大抱负和责任，须以前瞻性的眼光和精致的作品引导社会，提升民众的审美品味和生活品质，这也是设计在社会进展过程中的根本功能所在。    我们遵循大师的教诲，追寻前辈的足迹，努力涉取传统文化精髓，借鉴并融合诸多美学元素和艺术语言，运用现代的演绎方式，赋予作品时代的美感和深刻的内涵。', '479081532'),
