('跑跑腿扬州电子商务有限公司', 25, 0, NULL, NULL, '扬州市广陵区鼎兴路89号扬州市食品产业园内', '跑跑腿扬州电子商务有限公司', 'zhilian', 'http://company.zhaopin.com/CC294715433.htm', '    跑跑腿扬州电子商务科技有限公司，是一家集电子商务、商贸、培训、软件技术开发、智能科技为一体的高新科技公司，旗下现有烟花三月O2O线下特色体验馆、跑跑腿电子商务平台、物流人才培训机构，其核心价值是打造扬州电子商务生态圈，引领电子商务潮流，使农户得到创收，使消费者得到实惠。    公司成立于2015年3月，注册资金3000万，地址为扬州市临江路2015号烟花三月馆（扬州市食品产业园内）。公司实力雄厚，拥有经验丰富的专业技术团队、品牌推广团队和管理团队。 作为扬州电商的领军企业，跑跑腿公司致力于激活扬州淘宝卖家，打造扬州特色产品供销平台，充分结合国家“丝绸之路经济带”及江苏文化特色的自身优势，以打造智慧城市，建设电子商务产业园为己任，打造扬州人自己的生活便民服务平台，带动扬州电商的迅猛发展，促进扬州经济腾飞。', '294715433'),
