('扬州航盛科技有限公司', 56, 0, NULL, NULL, '扬州市经济开发区 扬子江中路186号 智谷大厦南楼 6-7层', '扬州航盛科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC705065021.htm', '    扬州航盛科技有限公司，隶属于深圳市航盛电子股份有限公司。母公司成立于1993年，注册资本2.1亿元，拥有汽车电子行业国家级技术中心，国内市场占有率达四分之一，国内主要汽车厂产品覆盖率90%，经营产值近40亿元。      公司筹建于2011年,坐落于扬州市经济技术开发区智谷大厦，拥有3000平米的现代化研发场所，是一家主要从事汽车电子产品、智能辅助驾驶技术及智能网联服务整体解决方案的高新技术企业；目前拥有博士、硕士及高端技术人才200多人，其中90%以上为本科以上人才。预计3~5年将引进高端研发人员超过400人,年销售额将超亿元。公司致力于不断提升研发能力和创新能力，技术水平和研发能力均居于国内领先。    公司秉承“创新驱动、科技领航”的宗旨，不断进取，掌握包括汽车总线、导航陀螺算法、高级驾驶辅助系统核心算法、车载信息娱系统、智能网联解决方案、手机互联技术及车身控制模块等关键核心技术，获得数十项国家发明和实用新型专利。公司拥有先进的信息化管理平台，严格的流程管理体系，支持ISO/TS16949,ISO26262、CMMI4、ASPICE2 体系要求，具备国际化的领先竞争力。2016年 荣获江苏省“软件企业证书”称号；并取得了软件能力成熟度CMMI4级评估。      公司坚持“诚信，专注，拼搏，创新”的核心价值观，致力于追求卓越的产品体验，为客户不断的创造价值，旨在成为世界级、国际化的汽车电子优秀企业。', '705065021'),
