('扬州天苗科技有限公司', 62, 0, NULL, NULL, '江阳西路绿地锋创国际B座15楼', '扬州天苗科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC535000825.htm', '公  司  简  介 扬州天苗科技有限公司成立于2001年，是扬州地区专业从事软件开发的高科技公司，公司下设软件研发部、无锡物联网研究院扬州办事处、北斗卫星应用扬州总代理、市场推广部、客服部。主要围绕财政改革及政府财政信息网络系统（金财工程）建设的需要，从事相关软件的研制开发、推广应用、服务及网络构建工作，以各级财政和广大行政事业单位为服务主体，密切关注财政改革信息化需求，不断开发、完善财政管理改革过程中不同管理层次、不同管理模式、不同发展阶段的规范化、标准化信息技术与产品，并为各地“金财工程”的建设提供完整的解决方案。是 “金财工程”建设的软件供应商之一。天苗科技作为财政信息化的建设者和推进者，我公司将利用业界最新的计算机网络、信息技术，不断探索各种财政事务系统化、数字化、网络化的解决方案，为最终实现全国财政综合管理自动化而不懈努力；为此，公司将不断发扬“开拓、服务、求实、合作”的企业精神，树立公司的良好形象，建立扬州市财政信息化领域的第一品牌，并在此基础上争取成为省内行业最有价值的企业。', '535000825'),
('扬州宏创科技发展股份有限公司', 63, 0, NULL, NULL, '扬州市广陵区信息服务产业基地声谷二期11幢E座3F', '扬州宏创科技发展股份有限公司', 'zhilian', 'http://company.zhaopin.com/CC655296723.htm', '扬州宏创科技发展股份有限公司简介扬州宏创科技发展有限公司成立于2013年，是一家集自主研发、生产、销售、服务为一体的高科技公司。公司团队拥有的专业素质和丰富的行业经验，是一支具备超凡创意和活力的团队。公司专注于自助研发、生产DRP软件、OA软件、手机云系统等，经过不断努力，公司站在数据、软件技术的前沿，凭借现代化的企业管理手段与优秀高效的团队，不断发挥自身优势和整合行业资源，为企业提供全方位的服务，专业为成长型企业提供量身定制的信息化解决方案。目前，公司拥有完善的软件技术产品和专业的解决方案，生产的产品已涵盖生产、分销、物流、办公等多个方面，2013年，公司与地方龙头企业形成战略合作，将公司发展战略从单纯的信息网络维护、软件开发向电子商务环节延伸。即面向市民推出“线上订货，线下取货”蔬菜订购配送服务，将蔬菜基地绿色天然的放心蔬菜从基地采摘后直接送到家门口的线下取货点，做市民家门口的果蔬园！    作为一家发展中的高科技公司，宏创科技秉持精诚合作的企业精神，倡导简单和谐的人际关系；在研发上，我们始终坚持严谨、创新的科学态度；在经营上，我们以服务共赢作为企业的经营理念；在售前，我们认真细致听取客户需求，为客户选择最合适的产品, 提供最佳解决方案；在售后，我们耐心解答客户问题，及时、准确接收客户的反馈信息，改进我们的产品和服务，让我们的客户在激烈的市场竞争中处于有利位置，并抢占商机，以卓越优质的服务提升企业核心竞争力。     ', '655296723'),
('江苏南邮电信工程有限责任公司', 64, 0, NULL, NULL, '江苏南邮电信工程有限责任公司', '江苏南邮电信工程有限责任公司', 'zhilian', 'http://company.zhaopin.com/CC564353927.htm', '       江苏南邮电信工程有限责任公司(原名南京邮电大学电信工程公司.以下简称南邮公司)是南京邮电大学控股的股份制企业,企业注册资本1800万元,具有国家工信部核准颁发的通信信息网络系统集成乙级资质证书、住建部颁发的电信工程专业承包三级资质证书.南邮公司成立于1994年,依托南京邮电大学在软件及其通信领域的技术和人才优势,已进入软件开发、光纤数字通信、无线微波通信、移动通信、交换、会议电视、楼宇自控、综合布线等技术领域的工程设计、施工与维护,参与了有关科研项目及通信产品的代理与销售。          公司在长期保持省内软件行业及通信工程服务综合实力最强、省外稳居全国同类企业前列的基础上，始终坚持创新发展，近几年来更在优先服务好江苏全省、积极拓展省外和国外软件开发及通信工程市场的快速发展过程中，在国家“推动信息化和工业化深度融合”发展战略和推进企业科技进步政策的引导下，走出了一条科技含量日益提高的创新发展之路。公司在全年多达数万个工程服务项目中，注重发挥和运用好技术和管理优势；围绕全业务经营，重点针对行业系统集成、信息咨询设计与产品研发生产，突出培育通信信息网络建设与维护、网规网优、系统集成、小区智能化等具有业内领先水平的专业服务领域；公司在传统通信市场、集团客户市场及海外市场的拓展中屡有良好表现，及时完成了大批急难险重的工程任务，受到业内和社会各界的多方好评。 ', '564353927'),
('扬州网畅智城网络科技有限公司', 65, 0, NULL, NULL, '扬州市广陵区汽车东站信息产业基地一期9号2楼', '扬州网畅智城网络科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC623891621.htm', '扬州网畅智城网络科技有限公司定位为城市级WiFi运营商，深耕国内二三线城市，目前在扬州、泰州、常州、徐州、连云港、重庆等省内外多地设立区域公司，独创城市级微信连WiFi体系，全力打造区域第一“移动媒体+O2O平台”。 我们拥有自主知识产权的WIFI设备及云端管理平台，通过与政府主管部门及电信运营商的深度合作，为江苏省范伟内的商户、景区、会展、大型活动以及公共区域等提供成熟的公共WIFI服务。我公司主要业务包括无线网络建设、信息安全维护、移动新媒体建设与服务、移动互联网技术开发、企业品牌推广等！分公司扬州北斗软件有限公司是一家专业从事软件开发的企业，主要业务分为三类：为传统企事业单位定制开发O2O软件，为其提出线上线下一体化解决方案；为企业提供行政办公应用软件设计、开发、维护一站式的服务；开发“WiFi+”软件，通过WiFi固件研发、行业软件开发，为行业提供O2O方案。                ', '623891621'),
