('上海国丹医院投资管理有限公司', 68, 0, NULL, NULL, '南京市中华路127号外运大厦9楼（夫子庙水游城旁边）', '上海国丹医院投资管理有限公司', 'zhilian', 'http://company.zhaopin.com/CC512649728.htm', '上海国丹医院投资管理有限公司坚持强内功、塑形象、引人才、铸精品，旗下吸纳各界精英和各类专业人才同舟共济、携手打拼，凝聚成了一种勤勉敬业、务实创新、超越自我、追求卓越的企业文化。　　上海国丹医院投资管理有限公司系一家集医疗投资、管理、培训为一体的股份制公司，公司系部队医院指定的医院管理输出公司，主要有医疗人才、管理人才、医学专家输出、资金输出、设备投资等。公司已成功同全国三甲医院强强联手合作近20家。为了让更多优秀人才加入公司团队，公司常年面向社会招聘各专业人才。　　公司秉承“以人为本、任人唯贤、唯才是举”的用人原则，以“企业文化培养优秀员工，以优秀员工创造一流品牌，以一流品牌推进规模发展，以规模发展追求企业进步，以企业进步凝聚优秀人才”的人才管理理念，力争为每位员工提供一个充满活力、竞争公平、劳有所得的职业发展平台，努力实现所有员工的自我价值和社会价值。　　公司诚邀社会各界有识之士的加盟，共同开创更加美好的未来。感谢各位朋友给予关心与支持。我们将加倍努力，并在未来的深入合作中，将更多的关爱回报给员工和社会。', '512649728'),
('海普康(扬州)自动化技术有限公司', 69, 0, NULL, NULL, '扬州市科技区广陵产业园路25号科创园B1幢', '海普康(扬州)自动化技术有限公司', 'zhilian', 'http://company.zhaopin.com/CC538591328.htm', '﻿﻿海普康（扬州）自动化技术有限公司是上海拓普控制工程有限公司在扬州投资的全资子公司。上海拓普公司始创于1995年，是专业从事自动化控制电气产品研发和系统集成的股份合作制技术型企业。        公司总部位于上海浦东新区金桥出口加工区南区中邦商务园，专业从事自动化产品的设计研发和市场营销工作。公司在风景秀丽古城江苏省扬州市广陵产业园科创园建有加工制造基地—海普康（扬州）自动化技术有限公司。        公司早期主营业务主要从事自动化控制工程项目系统设计制造及现场调试服务，参与了该帘子线化纤行业从化工聚合，纺丝，牵伸，加捻，织布，浸胶全流程自动化系统控制项目，取得了良好工程业绩，国内帘子布龙头骨干企业都选用了我公司专为此行业研制的控制系统产品，并与我公司建立了长期良好协作关系。同时公司还积极参与了跨行业自动化控制系统项目，包括老系统升级换代改造和进口电气系统替代改造。        2002年起与国内知名纺机企业以ODM合作方式开展机电一体化战略合作，先后成功研发了K3501A/B直捻机电控系统，K3502地毯直捻机电控系统，K3521工业丝倍捻机控制系统，CGKV548C/CGKV549C玻捻机四大电控系统，均已得到配套推广应用和出口欧美东南亚等国家，其控制系统水平在可靠性和性能上处国内领先位置，并对类似进口机械装置其控制系统具备替换性。        2004年与浙江金轮机电有限公司以机电股份合作形式组建上海金轮拓普机电有限公司，专业从事帘子布浸胶机机电一体化设计制造及销售服务。主要产品有帘子布单浴/双浴浸胶机，帘子线单浴/双浴浸胶机，帘子线单浴/双浴浸胶试验机。国内帘子布主要骨干企业和一些外资企业都选用了我公司浸胶机产品，该浸胶生产线产品凭借良好性价比优势已成功进入海外市场。        2008年起正式涉足船舶自动化船控产品领域，以超越同行的独特全新设计理念和品牌定位，进行船控产品研发，先后推出了海普康®新一代航行灯信号灯控制器，航海故障报警器，桥楼值班报警系统，船舶信息化管理系统等船控产品，业已取得良好市场反响，全系列船控产品已列入公司研发规划，不远将来海普康®将为船舶自动化行业献上更多精彩作品。        我们将凭借多年来从事工业自动化控制项目积累的技术研发优势与工程经验，把技术创新与技术研发作为公司生存与发展的原动力，珍惜市场赋予我们的每一次机会，点滴积累辛勤耕耘，向成熟自动化公司迈进，成为有行业影响力的受人尊敬的自动化公司，为民族自动化领域增光添彩。', '538591328'),
