('江苏创新睿智科技有限公司', 91, 0, NULL, NULL, '兴城西路191号金缘国际大厦5F', '江苏创新睿智科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC532499625.htm', '江苏创新睿智科技有限公司成立于1997年10月30日,公司原名称为"扬州创新科技有限公司",2009年10月10日变更为"江苏创新系统集成有限公司"，2011年12月1日变更为“江苏创新睿智科技有限公司”.公司主要从事建筑智能化系统工程,计算机信息化系统集成工程的设计、施工与服务等。    公司创建伊始，就明确了技术上的高起点，所以始终占据着计算机应用技术的前沿领域。在近两年中，紧跟国际前沿科技，充分利用4C技术：现代计算技术（Computer）、现代通信技术(Communication)、现代控制技术(Control)、现代显示技术(CRT)。在建筑智能化系统工程（智能大厦）系统集成、多媒体电视监控系统产品开发、计算机网络工程等诸多领域皆取得了卓越的成就。    公司建立了完整的质量保证体系------"质量管理手册"。    为了迅速引进国际先进技术，加速我国信息产业的发展，公司同国际上众多著名IT厂商签署了代理协议或建立了密切的商务与技术合作关系。其中有D-Link、IBM、 HP、AMP、Microsoft、AD、C&K、CANON、EPSON、SUN等著名公司。利用国际上最先进的信息技术与产品来武装我们的产品和工程，使我们的技术脉搏与国际同步。    创新睿智科技公司深深懂得，最好的投资在于人才培养和技术开发。现已形成了从技术工人、工程师到高级工程师对尖端产品及系统工程的设计、开发、生产群体，拥有一些包括教授、研究生在内的技术骨干，并严格遵循ISO9001国际标准和本公司的企业标准---《质量管理手册》，从而在技术力量和科研生产管理上保证了创新科技公司开发产品和营造工程的高品质和高可靠性。', '532499625'),
