('靖江市旭飞安防工程有限公司', 94, 0, NULL, NULL, '城北工业园区长新路16号', '靖江市旭飞安防工程有限公司', 'zhilian', 'http://company.zhaopin.com/CC230531538.htm', '    靖江市旭飞安防工程有限公司是集科、工、贸为一体的高新技术企业、中国安防产品行业协会常务理事单位、专业为社会各领域周界及要害部位提供高性能安防产品以及一揽子解决方案。产品包括：周界电网监防系统、周界安防集成系统、监室门、铁木床、人员定位系统、智能视频侦测系统等。    多年来，旭飞安防以先进可靠的产品性能、优良的全程服务以及不懈努力的专业作风获得了广大公安、司法、部队、运营商等客户群体的普遍认可。相关产品已应用于全国各地及部分国外用户，其中周界电网系统的使用单位已达到2500余家，占全国已装备总量的40%左右，并荣获“平安城市优秀安防产品”及行业免检资格。公司技术上与东南大学、北京工业大学长期合作，拥有一支专业齐全的技术研发及应用团队，先后发起并参与制定了《周界高压电网》、《监室门》、《电子脚扣》、《铁木床》、《公安监所装备建设保障规范》等国家标准或行业标准，为行业标准化工作发挥了重要作用，成为行业内引领相关产品装备建设标准化的领跑者。    近年来，随着建设平安城市，建设和谐社会的深入推进，公司根据行业需求特点，为最大限度提升安防效能，减轻人员工作流程，充分运用导入物联网技术，开发了人员定位管理系统，智能视频系统等新产品，同时，率先推出了感知监所理念及周界解决方案，让监所管理更智慧，更安全……    新的形势新的探索，旭飞安防将承前启后，以“精细、增值”的服务理念，不断进取，愿与业内各界紧密携手，共创安防事业新篇章！', '230531538'),
