('扬州本汇经贸发展有限公司', 96, 0, NULL, NULL, '渡江南路110号江南左岸AB-610室', '扬州本汇经贸发展有限公司', 'zhilian', 'http://company.zhaopin.com/CC521851024.htm', ' 本公司经营服装品牌代理销售，公司现运营两个天猫商城店铺，急需人才，团队成员年轻有朝气，氛围很好，欢迎愿与团队一起发展的有识之士加入！', '521851024'),
('扬州瑞控汽车电子有限公司', 97, 0, NULL, NULL, '江苏省 	 扬州市 	扬子江北路413号', '扬州瑞控汽车电子有限公司', 'zhilian', 'http://company.zhaopin.com/CC245196936.htm', '扬州瑞控汽车电子有限公司，汇聚汽车电子行业的资深专家，致力于为客户提供业界领先的汽车智能产品。公司为客户定制基于雷达和视频传感器的智能汽车解决方案、车载电源，电池管理系统解决等。公司的研发团队由技术专家和行业精英组成，目前博士5人，硕士12人。公司产品涵盖汽车新能源技术和智能安全领域，拥有发明专利11项，实用新型专利3项。公司网站：http://www.yzruikong.com/', '245196936'),
('扬州集群广告有限公司', 98, 0, NULL, NULL, '扬州火车站站南路扬州市邗江电子商务创意产业园3楼305号', '扬州集群广告有限公司', 'zhilian', 'http://company.zhaopin.com/CC275241334.htm', '扬州集群广告有限公司及北京集群展览有限公司、扬州集群互联软件有限公司是一家以软件、网络、展览、DM广告为发展方向的民营高科技综合性商务服务企业。事业领域：扬州集群广告有限公司主要发展DM广告事业，北京集群展览有限公司主要发展博览事业，扬州集群互联软件有限公司主要发展软件、网络事业。集群系列公司有广阔的发展前景，期待与志同道合的人士共同成就！', '275241334');
INSERT INTO `ss_company` (`company`, `id`, `delflag`, `createAt`, `updateAt`, `addr`, `name`, `src`, `url`, `detail`, `refid`) VALUES
('南京软航信息科技有限公司', 99, 0, NULL, NULL, '南京雨花台区花神大道23号雨花科技园1号楼311', '南京软航信息科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC394205131.htm', '  南京软航信息科技有限公司是以软件研发、信息技术、服务外包及软件技术培训为主的综合型全方位IT服务公司，公司坐落在江苏省软件核心区域——中国（南京）软件谷雨花科技园内。   江苏航软科技集团公司坐落在长三角北翼新兴城市——江苏省淮安市，是以软件服务外包产业为主导的多功能综合性企业集团，总部设在周恩来总理故乡——淮安，子公司及合作机构分布在全国多个省市，集团旗下的航软软件实训、互联网金融、银行模拟实训、电子商务培训、航空及无人机服务、校企合作等多个功能项目.作为江苏航软科技有限公司南京公司，延续了总公司的技术优势、人才优势，为了更好的向华东地区用户提供更为优质的服务。  江苏航软拥有专业化的高水平研发团队，拥有高素质且经验丰富的技术支持团队、市场营销团队和企业管理团队，在技术岗位中80％以上的员工具有软件开发、计算机、网络通信、电子信息等专业的大学本科、硕士、博士研究生学历，他们在从事嵌入式系统开发、网络虚拟化、深度包分析、DMA零拷贝性能优化、数据包高速处理、应用协议分析、应用检测算法、信息安全等方面，积累了丰富的经验，实现了许多重大的技术突破。公司目前正处于高速发展的关键时期，我们决心在秉承优良传统的同时，不断地挑战自我，打破不适合发展的各种制约，勇敢地进行技术创新，与时俱进，在激烈的市场竞争中发展、突破，获得持久的生命力，并众志诚城，抱团负重，创造出最佳的社会和经济效益。', '394205131'),
('南京百视维视觉设计有限公司', 100, 0, NULL, NULL, '南京市江宁区天元东路58号致远大厦701室（竹山路地铁口、思伯特投创产业园）', '南京百视维视觉设计有限公司', 'zhilian', 'http://company.zhaopin.com/CC417380723.htm', '    百视维设计是一家集品牌创意设计、平面广告设计、大型专业人才实训为一体的新型设计公司，公司秉承“诚信铸就品牌、出色源于专业”为企业理念，以丰富的市场运作能力及严谨的团队协作精神，完美的组合及完善的服务，一直为客户提供实效的品牌传播。百视维解答疑问问：做设计的前景怎样？三百六十行，行行出状元，每个行业都有很多优秀人才，随着经济的发展，商业对设计需求只会越来越多，商品需要广告，广告就需要设计人才，而我们的学员第一年平均工资在3500元左右/月，所以做好设计前景还是非常好的。问：没有美术基础或者天赋可以学设计吗？美术和天赋能成就你的设计，两者兼有你可能成为一代大师，但是并不是说没基础或是没天赋就不可以学设计，设计是后天学习得到的技能，只要肯努力，没有任何基础且做的很好的设计师大有人在，只要你用功，找到好的设计学习方法，做好设计完全没有问题。问：设计是不是学会PS/AI/CDR等设计软件就可以了？平面设计重在设计，不是软件，但并不是说软件可以忽略，软件是工具，是基础，不是重点更不是全部，所以不要把设计看成会软件就OK，那样你的设计水平一直停留在软件的操作上，没有想法既是没有灵魂。问：即使是本专业本科毕业生找工作为什么很难？不是找不到工作，是找不到自己满意的工作，问题出在哪？理念、心态、交流、是困扰毕业生的问题1、理念：在学校学的设计过于艺术理论化，设计并非纯艺术，商业设计更注重商业，在学校审核作品的是老师，在社会审核作品的是客户、是市场，前一类是艺术设计，后一类是商业设计，理念偏离。2、心态：刚毕业的大学生大都好高骛远，小公司不愿进，大公司进不了，所以一定要认清自己的实力，3、交流：商业设计注重交流，注重与客户交流、与市场交流、与消费者交流、与同事交流，不是自娱自乐，很多刚出校门的学生喜欢独立完成，没有所谓的团队合作精神。 ', '417380723'),
('江苏华信科技有限公司', 101, 0, NULL, NULL, '扬州市开发区扬子江中路287号财富广场综合楼11楼', '江苏华信科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC535963528.htm', '江苏华信科技有限公司位于江阳中路财富国际综合楼内，是一家综合性的自然人控股的科技有限公司，旗下拥有通信工程公司和通信技术服务分公司。我公司系中国电信、中国移动、中国联通、江苏广电的战略合作伙伴，秉承“诚信合作，贴心服务，勇于创新，勇攀高峰”的经营理念，主要从事通信器材及通信设备的销售、安装；软件研发、销售和调试；无线网络优化技术服务；计算机系统设计、集成及维护；通信工程规划设计；市政工程及配套工程设计和施工,在业内拥有较好的信誉度和知名度。', '535963528'),
('昆山顶硕电脑有限公司', 102, 0, NULL, NULL, '苏州市高新区嵩山路湘江路', '昆山顶硕电脑有限公司', 'zhilian', 'http://company.zhaopin.com/CC296092018.htm', '昆山顶硕电脑有限公司主要经营：电脑硬件、网络产品、办公耗材、办公家具批发、零售；软件开发。等产品。公司尊崇“踏实、拼搏、责任”的企业精神，并以诚信、共赢、开创经营理念，创造良好的企业环境，以全新的管理模式，完善的技术，周到的服务，卓越的品质为生存根本，我们始终坚持用户至上 用心服务于客户，坚持用自己的服务去打动客户。', '296092018'),
('阿尼信息技术股份有限公司', 103, 0, NULL, NULL, '汽车东站信息服务产业基地二期12号楼C栋五楼', '阿尼信息技术股份有限公司', 'zhilian', 'http://company.zhaopin.com/CC699460729.htm', '江苏阿尼信息技术有限公司是一家由海外创投成立的科技型企业，公司成立于2011年5月，注册资金5000万元，目前公司下辖扬州远梦科讯有限公司、连云港德乐科技发展有限公司、扬州微软职业培训学校、泰州阿尼信息技术有限公司四家子公司，在扬州、泰州、连云港地区主要从事万店通、社区通、民生通系列软件研发、人才培训、手机终端销售业务。公司先后获得IS027***信息安全质量体系、江苏省软件企业、江苏省民营科技企业、江苏省三星中小企业服务平台、江苏省高新技术企业等多项认证。公司于2012年5月投资500余万元运营了微软（扬州）IT学院，并于2013年8月投资200万元成立了扬州市微软职业培训学校，同时还拥有国家工信部GCC/NTC（网游动漫学院）项目江苏省管理中心和Oracle金牌合作伙伴资质。在拥有了这些资源后，公司面向扬州市现代服务业和传统行业等各类企业开展了培训业务，累计培训人次达5000余人，受众企业500余家，并和我市多所大中专、高职学校合作办学，为在校学生提供实训课程，为企业输送实用型人才。公司未来将致力于扬州及周边地区的培训和电商服务平台业务发展，提供高中低端“金字塔”型的服务体系，涵盖CIO（企业信息技术官）、软件研发类、电子商务类、办公自动化能力提升等方面。公司将以扬州为总部，辐射周边地区，成为国内知名的培训及软件研发型企业。', '699460729'),
('江苏智途科技股份有限公司', 104, 0, NULL, NULL, '江苏省扬州市广陵区声谷信息产业基地二期11号楼B座3层', '江苏智途科技股份有限公司', 'zhilian', 'http://company.zhaopin.com/CC285600536.htm', '    江苏智途科技股份有限公司（智途科技 832282）成立于2006年，总部位于江苏信息服务产业基地（扬州），是创业板上市公司银江股份（300020）旗下智慧城市战略联盟企业，下属有全资子公司北京亿程信息技术有限公司、合肥佳途信息技术有限公司、广州启辰信息技术有限公司，控股子公司成都慧途科技有限公司，下属分公司江苏智途科技股份有限公司武汉分公司，扬州智途计算机培训学校，并与武汉大学合作建立有空间信息大数据研发基地，与北京师范大学合作建立有卫星遥感数据应用研究基地。    公司是专业从事地理信息系统开发及应用服务的高新技术企业，专注于各种地图数据采集和处理、应用软件开发及地理信息测绘等业务，服务于智慧城市、智慧旅游、智能交通、智慧政务等领域。    2015年4月21日，公司成功登录新三板，构建起了以各种地图数据采集和处理、各类地理信息系统开发和技术转让、高端测绘装备研发销售为一体的服务体系，并逐步形成以智途科技为中心的地理信息行业技术和产品全面的集团化企业，为未来的智慧生活提供产品和技术支持。福利：股权激励 无息借款  年终奖  带薪年假 社保五险      晋升渠道 黄埔培训 节日福利 生日福利 社团活动', '285600536'),
('扬州映台电子科技有限公司', 105, 0, NULL, NULL, '扬州市邗江中路330号星座国际商务中心501~502室', '扬州映台电子科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC296676132.htm', '扬州映台电子科技有限公司成立于2013年7月，公司主要从事包括各式车载液晶显示终端、车载影音娱乐系统、车载导航系统及各式车载控制单元的研发设计及销售。公司拥有优秀之开发团队，目前在车身网关控制通讯（CAN／VAN）、前装GPS／Gyro／3D导航、多功能数字显示平台及娱乐多媒体播放等方面建构完整的产品线，对于新一代3G／4G通信技术的整合应用，以及智能手机的APP应用等趋势，将会全力打造优势技术平台，来提供客户最新及最可靠的体验。意向应聘者请电询0514-80820011-113或发送邮件至yzrln@join-link.com.cn,注明"应聘岗位+姓名",谢谢!', '296676132'),
('江苏万润软件科技有限公司南京分公司', 106, 0, NULL, NULL, '南京市雨花台区软件大道180号07栋405室', '江苏万润软件科技有限公司南京分公司', 'zhilian', 'http://company.zhaopin.com/CC256886432.htm', '万润软件，国家级高新技术企业，原世星软件、江苏万宇软件科技，创始于1996年，是一家集咨询、研发、实施、运维为一体的综合型专业软件企业，并提供BIM技术实施应用服务。是目前工程建设行业顶级的软件服务商之一。公司致力于工程建设行业信息化服务二十年，目前拥有近百项企业管理软件著作权，形成了完善的施工企业信息化管理软件产品体系。相关产品已广泛应用于全国各地施工企业，即有世界500强企业，也有大量的国有和民营企业。系统专业、实用、好用，项目实施成功率高，受到客户的广泛好评。公司连续三年受中国施工企业管理协会邀请作为第一协会方成功协办了第十届、第十一届、第十三届“全国工程此外，本着“创新是企业的生命”这一宗旨，公司大力开展人才队伍建设，目前已拥有一支实力强劲的研发队伍，囊括多位博士、硕士研究生，以及一大批拥有多年软件行业从业经验的有识之士，万润大家庭在所有人的努力下不断壮大、不断成长。', '256886432'),
('上海纪伊信息技术有限公司扬州分公司', 107, 0, NULL, NULL, '扬州广陵江广智慧城北大训练营基地', '上海纪伊信息技术有限公司扬州分公司', 'zhilian', 'http://company.zhaopin.com/CC447353683.htm', '        上海纪伊信息技术有限公司（C Cloud)，服务于0-3早教机构和3-12儿童素质教育机构，向这些机构提供管理云平台和公益性的培训公开课。         公司为初创公司，公司创始人皆为行业精英，来自东软贝塔斯曼SAP等，行业经验和技术能力都非常棒。目前公司产品已经上线，已经有大量的使用用户，接下来需要拓展市场，提高市场份额以及扩大产品模块（跨界）。公司快速发展需要更多的人才加入，共享早教这个朝阳产业的大蛋糕。                             ', '447353683'),
('扬州宏诚智能科技有限公司', 108, 0, NULL, NULL, '扬州广陵区科技大道科技大厦', '扬州宏诚智能科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC683307426.htm', '扬州宏诚智能科技有限公司是一家专门从事物联网技术研发、生产、销售的公司，产品广泛应用智能楼宇、智能家居、工业自动化、安防、医学、农业、军事等领域。智能家居一般是以住宅为基础平台，综合建筑装潢、网络通信、信息家电、设备自动化等技术，将系统、结构、服务、管理集成为一体的高效、安全、便利、舒适、环保的居住环境和具有高度人性化的生活空间。将一批原来被动静止的家居设备转变为具有“智慧”的工具，提供全方位的信息交换功能，帮助家庭与外部保持信息交流畅通，优化人们的生活方式，帮助人们有效地安排时间，增强家庭生活的安全性，并为家庭节省能源。 目前，我们和众多国际国内一线品牌战略合作。我们在发展的道路上以便捷、安全、舒适、环保节能为主题，将始终如一的职业操守与智能化事业融为一体，为智能化普遍应用和发展做出贡献。', '683307426'),
('扬州创杰信息系统集成有限公司', 109, 0, NULL, NULL, '扬州市扬子江北路101号双桥商务广场', '扬州创杰信息系统集成有限公司', 'zhilian', 'http://company.zhaopin.com/CC416167615.htm', '扬州创杰信息系统集成有限公司成立于2006年，是扬州一家集计算机网络、信息化设备、机房建设、门禁考勤等安防、智能化系统为主要经营项目的信息化科技公司。公司拥有经验丰富的专业工程师、项目技术负责人及工程技术人员。工程师在相关的领域里具有丰富的现场经验，可以为用户提供优化的系统解决方案及实施项目的技术支持。公司已和众多设备供应商达成了战略合作伙伴，拥有全方位的技术支持，能更好的服务客户。现在，公司的业务范围涉及政府机关、企业单位、教育行业、金融业等。赢得了广大客户的好评。公司自成立以来，始终把客户的要求放在第一位，致力于从客户的需求出发，为客户做出最适合的系统集成方案，要建设“一切以客户价值为中心、涵盖售前、售中、售后的全程服务体系”。在售后方面，我们更加的注重，我们坚信：“良好的售后服务是下一次合作的最好的开始！” 7*24小时的服务，为您和您的公司创造一个安全，稳定的高科技信息应用平台。企业精神：以人为本 发展创新 居危思进 争创一流　　服务理念：诚信 务实 热情　　企业宗旨：用过硬的产品服务社会 用创新的科技丰富社会', '416167615'),
('江苏瑞丰信息技术股份有限公司', 110, 0, NULL, NULL, '扬州市邗江区扬子江中路186号智谷产业园', '江苏瑞丰信息技术股份有限公司', 'zhilian', 'http://company.zhaopin.com/CC440282220.htm', '江苏瑞丰信息技术股份有限公司成立于2011年，总部位于扬州经济技术开发区，拥有北京、上海、广州、南京、泰州、扬州等七家分子公司，公司总人数达到300人。 公司专注于数字营销的技术、产品、服务的创新与整合，致力于客户与大型互联网媒体厂商之间的第三方移动数字营销服务平台，为所服务的企业提供全新的互联网精准营销模式及整体解决方案。公司经过几年的迅速发展，也吸引了很多投资者的青睐，先后获得以色列英菲尼迪基金、平衡宜创资本等多个风投基金A轮资本投入，公司目前正进行B轮融资阶段，并于2016年进入资本市场。 公司近年来从腾讯、微软、华为等知名IT企业引进优秀技术研发人才，设计开发了多款具有自主知识产权的互联网专利产品。与东南、南大、扬州大学等知名院校建立长期战略合作关系，先后投资近千万创建了“移动大数据采集中心”和“新媒体应用技术中心”，并与新浪、腾讯、百度、谷歌等国内外优秀企业建立了良好的战略伙伴关系。公司已经由一家互联网基础服务转变成为多元一体化的数字技术营销服务企业。 2014年，公司荣获“国家软件奖”；2015年公司被评定为“双软企业”及“国家高新技术企业”，并被江苏省经信委评为“10家重点电子商务综合服务平台”；2016年，公司旗下“新贸通”被江苏省商务厅评为省级外贸综合服务企业。 ', '440282220'),
('扬州航盛科技有限公司', 111, 0, NULL, NULL, '扬州市经济开发区 扬子江中路186号 智谷大厦南楼 6-7层', '扬州航盛科技有限公司', 'zhilian', 'http://company.zhaopin.com/CC705065021.htm', '    扬州航盛科技有限公司，隶属于深圳市航盛电子股份有限公司。母公司成立于1993年，注册资本2.1亿元，拥有汽车电子行业国家级技术中心，国内市场占有率达四分之一，国内主要汽车厂产品覆盖率90%，经营产值近40亿元。      公司筹建于2011年,坐落于扬州市经济技术开发区智谷大厦，拥有3000平米的现代化研发场所，是一家主要从事汽车电子产品、智能辅助驾驶技术及智能网联服务整体解决方案的高新技术企业；目前拥有博士、硕士及高端技术人才200多人，其中90%以上为本科以上人才。预计3~5年将引进高端研发人员超过400人,年销售额将超亿元。公司致力于不断提升研发能力和创新能力，技术水平和研发能力均居于国内领先。    公司秉承“创新驱动、科技领航”的宗旨，不断进取，掌握包括汽车总线、导航陀螺算法、高级驾驶辅助系统核心算法、车载信息娱系统、智能网联解决方案、手机互联技术及车身控制模块等关键核心技术，获得数十项国家发明和实用新型专利。公司拥有先进的信息化管理平台，严格的流程管理体系，支持ISO/TS16949,ISO26262、CMMI4、ASPICE2 体系要求，具备国际化的领先竞争力。2016年 荣获江苏省“软件企业证书”称号；并取得了软件能力成熟度CMMI4级评估。      公司坚持“诚信，专注，拼搏，创新”的核心价值观，致力于追求卓越的产品体验，为客户不断的创造价值，旨在成为世界级、国际化的汽车电子优秀企业。', '705065021'),
('扬州乐博百货有限公司', 112, 0, NULL, NULL, '扬州市广陵区声谷信息产业园10号楼318', '扬州乐博百货有限公司', 'zhilian', 'http://company.zhaopin.com/CC606462425.htm', '本公司专营电子商务，坐落于扬州东区，公司位于扬州声谷信息产业园区。现有天猫商城店铺3家，金冠C店一家，主要经营母婴产品，及生活日用品。企业要发展，人才是关键，公司处于不断扩大发展之中，正值用人之际。这里为您提供了足够的舞台，期待您的加盟', '606462425'),
('南京东软睿道信息技术有限公司', 113, 0, NULL, NULL, '南京市雨花区花神大道86号', '南京东软睿道信息技术有限公司', 'zhilian', 'http://company.zhaopin.com/CC600861126.htm', '东软是中国最大的IT解决方案与服务供应商。1991年，东软创立于中国东北大学。目前，公司拥有员工20000余名，在中国建立了6个软件研发基地，8个区域总部，在40多个城市建立营销与服务网络，在大连、南海、成都和沈阳分别建立3所东软信息学院和1所生物医学与信息工程学院，在沈阳、大连、南京、成都和无锡建立了分布式实训基地；在美国、日本、欧洲、中东设有子公司。东软以软件技术为核心，通过软件与服务的结合，软件与制造的结合，技术与行业管理能力的结合，提供行业解决方案和产品工程解决方案以及相关软件产品、平台及服务。', '600861126');
